(function($){
	var CJT = 'jquery-tree';
	var CJT_CONTROLS = 'jquery-tree-controls';
	var CJT_COLLAPSED = 'jquery-tree-collapsed';
	var CJT_HANDLE = 'jquery-tree-handle';
	var CJT_TITLE = 'jquery-tree-title';
	var CJT_NODE = 'jquery-tree-node';
	var CJT_LEAF = 'jquery-tree-leaf';
	var CJT_CHECKED = 'jquery-tree-checked';
	var CJT_CHECKED_2 = 'jquery-tree-checked-2';
	var CJT_UNCHECKED = 'jquery-tree-unchecked';
	var CJT_CHECKED_PARTIAL = 'jquery-tree-checked-partial';
	var TREE_CONTROLS_CODE = '<div class="' + CJT_CONTROLS + '"></div>';

	var TREE_NODE_HANDLE_CODE = '<span class="' + CJT_HANDLE + '">+</span>';
	var TREE_NODE_HANDLE_COLLAPSED = "+";
	var TREE_NODE_HANDLE_EXPANDED = "&minus;";

	$.fn.extend({
		Tree: function(){
			$(this)
				.addClass(CJT)
				.before(TREE_CONTROLS_CODE)
				.prev('.' + CJT_CONTROLS)
			$('li', this).find(':first').addClass(CJT_TITLE)
				.closest('li').addClass(CJT_LEAF);

			$('li:has(ul:has(li))', this).find(':first')
				.before(TREE_NODE_HANDLE_CODE)
				.closest('li')
					.addClass(CJT_NODE)
					.addClass(CJT_COLLAPSED)
					.removeClass(CJT_LEAF);

			$('.' + CJT_HANDLE, this).bind('click', function(){
				var leafContainer = $(this).parent('li');
				var leafHandle = leafContainer.find('>.' + CJT_HANDLE);

				leafContainer.toggleClass(CJT_COLLAPSED);

				if (leafContainer.hasClass(CJT_COLLAPSED)) leafHandle.html(TREE_NODE_HANDLE_COLLAPSED);
				else leafHandle.html(TREE_NODE_HANDLE_EXPANDED);
			});

			$('input:checkbox', this).click(function(){
				setLabelClass(this);
				checkCheckbox(this);
			})
			.each(function(){
				setLabelClass(this);
				if (this.checked) checkParentCheckboxes(this);
			})
			.closest('label').click(function(){
				labelClick(this);
				checkCheckbox($('input:checkbox', this));
			});
		}
	});

	function checkParentCheckboxes(checkboxElement){
		if (typeof checkboxElement == 'undefined' || !checkboxElement) return;
		
		var closestNode = $(checkboxElement).closest('ul');
		var allCheckboxes = closestNode.find('input:checkbox');
		var checkedCheckboxes = closestNode.find('input:checkbox:checked');
		var allChecked = allCheckboxes.length == checkedCheckboxes.length;
		var parentCheckbox = closestNode.closest('li').find('>.' + CJT_TITLE + ' input:checkbox');

		if (parentCheckbox.length > 0) {
			parentCheckbox.get(0).checked = allChecked;

			if (!allChecked && checkedCheckboxes.length > 0) {
				parentCheckbox.closest('label')
					.addClass(CJT_CHECKED_PARTIAL)
					.removeClass(CJT_CHECKED)
					.removeClass(CJT_UNCHECKED);
				parentCheckbox.closest('li').removeClass(CJT_CHECKED_2);
			}	
			else
				if (allChecked) {
					parentCheckbox.closest('label')
						.removeClass(CJT_CHECKED_PARTIAL)
						.removeClass(CJT_UNCHECKED)
						.addClass(CJT_CHECKED);
						parentCheckbox.closest('li').addClass(CJT_CHECKED_2);
				}
				else {
					parentCheckbox.closest('label')
						.removeClass(CJT_CHECKED_PARTIAL)
						.removeClass(CJT_CHECKED)
						.addClass(CJT_UNCHECKED);
						parentCheckbox.closest('li').removeClass(CJT_CHECKED_2);
				}

			checkParentCheckboxes(parentCheckbox.get(0));
		}
	}
	function checkCheckbox(checkboxElement){
		$(checkboxElement).closest('li').find('input:checkbox').each(function(){
			this.checked = $(checkboxElement).attr('checked');
			setLabelClass(this);
		});
		checkParentCheckboxes(checkboxElement);
	};
	function setLabelClass(checkboxElement){
		isChecked = $(checkboxElement).attr('checked');

		if (isChecked) {
			$(checkboxElement).closest('label')
				.addClass(CJT_CHECKED)
				.removeClass(CJT_UNCHECKED)
				.removeClass(CJT_CHECKED_PARTIAL);
			$(checkboxElement).closest('li').addClass(CJT_CHECKED_2);
		}
		else {
			$(checkboxElement).closest('label')
				.addClass(CJT_UNCHECKED)
				.removeClass(CJT_CHECKED)
				.removeClass(CJT_CHECKED_PARTIAL);
			$(checkboxElement).closest('li').removeClass(CJT_CHECKED_2);
		}
	};
	function labelClick(labelElement){
		var checkbox = $('input:checkbox', labelElement);
		var checked = checkbox.attr('checked');
		checkbox.attr('checked', !checked);
		setLabelClass(checkbox);
	}

})(jQuery);